import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ isLoggedIn, onLogin, onLogout }) {
  return (
    <nav className="bg-gray-800">
      <div className="container mx-auto px-4">
        <div className="flex justify-between items-center py-4">
          <Link to="/" className="text-white text-lg font-semibold">Mon Application</Link>
          <ul className="flex space-x-4">
            <li>
              <Link to="/" className="text-gray-300 hover:bg-gray-700 px-3 py-2 rounded-md">Accueil</Link>
            </li>
            <li>
              <Link to="/wilaya" className="text-gray-300 hover:bg-gray-700 px-3 py-2 rounded-md">Wilaya</Link>
            </li>
            {!isLoggedIn ? (
              <li>
                <button className="text-gray-300 hover:bg-gray-700 px-3 py-2 rounded-md" onClick={onLogin}>Se connecter</button>
              </li>
            ) : (
              <li>
                <button className="text-gray-300 hover:bg-gray-700 px-3 py-2 rounded-md" onClick={onLogout}>Se d√©connecter</button>
              </li>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
